/**
 * yangsu
 */
Vue.component('buttongroups', {
    template: '<div class="use-btn"><button type="button" class="btn-pub btn-green" style="margin: 0 5px;" v-for="(s,key) in button_arr" :key="key" :class="key == actions?\'btn-green\':\'btn-default\'" @click="selectkey(key)">{{s}}</button></div>',
    props: {
      button_arrs: {
        type: Array,
        required: true
      },
      actionin: {
        type: Number,
        required: false
      },
      name_ben: {
        type: String,
        required: false
      },
      key_ben: { required: false }
    },
    data: function data() {
      return {
        button_arr: this.button_arrs,
        actions: this.actionin,
        name: this.name_ben,
        key: this.key_ben
      };
    },
    methods: { selectkey: function selectkey(e) {
        this.actions = e;
        this.$emit('buttongroups', this.key, this.name, e);
      } }
  });